// src/Home.js
import React from 'react';
import Header from './Header';

import HeroSection from './HeroSection';
import FeaturesSection from './FeaturesSection';
import ContactSection from './ContactSection';
import Footer from './Footer';

function Home() {
  return (
    <div className="Home">
      <Header/>
      <HeroSection />
      <FeaturesSection />
      <ContactSection />
      <Footer />
    </div>
  );
}

export default Home;
